INSERT INTO `phrase` VALUES ('5831', '2', 'title', '1', 'Итальянская обувь Оксфорд', 'Italian Leather Oxford Dress Shoes by BOSS');
INSERT INTO `phrase` VALUES ('5834', '2', 'description', '1', 'Эти элегантные Оксфорд обувь по BOSS оснащены обновленной штриховки текстуры для современной взять на сложной повязки.', 'These elegant Oxford shoes by BOSS feature an updated crosshatch texture for a modern take on sophisticated dressing.');
INSERT INTO `phrase` VALUES ('5837', '2', 'title', '2', 'Патентные Мокасины', 'Italian Calfskin Patent Loafers by BOSS');
INSERT INTO `phrase` VALUES ('5840', '2', 'description', '2', 'Эти потрясающие бездельники по BOSS оснащены эластичной телячьей кожи итальянской верхом закончил с патентной блеском. Малые упругие вставки обеспечивают для комфортного передвижения вместе с кожаной подкладкой для ног кровати.', 'These stunning loafers by BOSS feature supple Italian calfskin uppers finished with a patent luster. Small elastic inserts allow for comfortable movement along with the leather-lined foot bed.');
INSERT INTO `phrase` VALUES ('5843', '2', 'title', '3', 'Т-Экс обувь', 'T-Exfull Dress Shoes by BOSS');
INSERT INTO `phrase` VALUES ('5846', '2', 'description', '3', 'Эти классические Оксфорд туфли от нашего BOSS с учетом сбора мастерски созданный с итальянского Блейк строчкой Entre Les единственным и верхней, позволяя более легкое, более гибкой подгонки. 3/4 лайнер установлен рядом с пяткой для вашего комфорта.', 'These classic Oxford dress shoes from our BOSS Tailored Collection are expertly crafted with Italian blake stitching between the sole and upper, allowing for a lighter, more flexible fit. A 3/4 liner is installed near the heel for your comfort.');
