INSERT INTO `phrase_det` VALUES ('5831', '5831', '1', 'Итальянская обувь Оксфорд');
INSERT INTO `phrase_det` VALUES ('5832', '5831', '2', 'Italian Leather Oxford Dress Shoes by BOSS');
INSERT INTO `phrase_det` VALUES ('5833', '5831', '3', 'Chaussures italiennes en cuir Oxford Dress par BOSS');
INSERT INTO `phrase_det` VALUES ('5834', '5834', '1', 'Эти элегантные Оксфорд обувь по BOSS оснащены обновленной штриховки текстуры для современной взять на сложной повязки.');
INSERT INTO `phrase_det` VALUES ('5835', '5834', '2', 'These elegant Oxford shoes by BOSS feature an updated crosshatch texture for a modern take on sophisticated dressing.');
INSERT INTO `phrase_det` VALUES ('5836', '5834', '3', 'Ces élégantes chaussures Oxford par BOSS disposent d\'une texture quadrillée mis à jour pour une version moderne de dressage sophistiqué.');
INSERT INTO `phrase_det` VALUES ('5837', '5837', '1', 'Патентные Мокасины');
INSERT INTO `phrase_det` VALUES ('5838', '5837', '2', 'Italian Calfskin Patent Loafers by BOSS');
INSERT INTO `phrase_det` VALUES ('5839', '5837', '3', 'Mocassins brevets italiens vachette par BOSS');
INSERT INTO `phrase_det` VALUES ('5840', '5840', '1', 'Эти потрясающие бездельники по BOSS оснащены эластичной телячьей кожи итальянской верхом закончил с патентной блеском. Малые упругие вставки обеспечивают для комфортного передвижения вместе с кожаной подкладкой для ног кровати.');
INSERT INTO `phrase_det` VALUES ('5841', '5840', '2', 'These stunning loafers by BOSS feature supple Italian calfskin uppers finished with a patent luster. Small elastic inserts allow for comfortable movement along with the leather-lined foot bed.');
INSERT INTO `phrase_det` VALUES ('5842', '5840', '3', 'Ces mocassins imprenable par BOSS disposent souples dessus en cuir de veau italien finis avec un éclat de brevet. Petits inserts élastiques permettent un mouvement confortable avec le lit de pied doublé de cuir.');
INSERT INTO `phrase_det` VALUES ('5843', '5843', '1', 'Т-Экс обувь');
INSERT INTO `phrase_det` VALUES ('5844', '5843', '2', 'T-Exfull Dress Shoes by BOSS');
INSERT INTO `phrase_det` VALUES ('5845', '5843', '3', 'T-Eksfill Shaw à habiller BOSS');
INSERT INTO `phrase_det` VALUES ('5846', '5846', '1', 'Эти классические Оксфорд туфли от нашего BOSS с учетом сбора мастерски созданный с итальянского Блейк строчкой Entre Les единственным и верхней, позволяя более легкое, более гибкой подгонки. 3/4 лайнер установлен рядом с пяткой для вашего комфорта.');
INSERT INTO `phrase_det` VALUES ('5847', '5846', '2', 'These classic Oxford dress shoes from our BOSS Tailored Collection are expertly crafted with Italian blake stitching between the sole and upper, allowing for a lighter, more flexible fit. A 3/4 liner is installed near the heel for your comfort.');
INSERT INTO `phrase_det` VALUES ('5848', '5846', '3', 'Ces classiques Oxford chaussures habillées de notre Tailored Collection BOSS sont savamment fabriqués avec italienne couture Blake entre la semelle et supérieure, permettant une tenue plus légère, plus souple. A 3/4 revêtement est installé près du talon pour votre confort.');
