INSERT INTO `phrase_det` VALUES ('8212', '8202', '1', 'В пространстве магазинов \"Galeries Lafayettе\" представлена исчерпывающая гамма коллекций предметов роскоши, - от часов и ювелирных украшений, одежды, обуви и аксессуаров класса Люкс (для женщин, мужчин, подростков и детей), - до завораживающих своей красотой и качеством предметов для дома от известных мировых Домов моды и дизайна. Такое богатство и разнообразие трудно себе представить в каком - нибудь отдельно взятом магазине формата «бутик», будь то в Лондоне, или в Париже. Высокая концентрация знаменитых брендов, собранных в унисон на изысканных торговых площадях \"Galeries Lafayettе\",- это то, что отличает «Большие магазины» («Grands Magasins») уровня «Galeries Lafayettе».');
INSERT INTO `phrase_det` VALUES ('8213', '8202', '2', 'In the space of stores \"Galeries Lafayette\" presents comprehensive range of collections of luxury goods - from watches and jewelry, clothing, shoes and luxury accessories (for women, men, teenagers and children) - to dazzling in its beauty and quality of the items for the house from world famous fashion houses and design. Such richness and diversity hard to imagine in what - ever a particular store format \"boutique\", whether in London or in Paris. The high concentration of famous brands, assembled in unison on the exquisite shopping areas \"Galeries Lafayette\" - this is what distinguishes the \"Large stores» («Grands Magasins») level «Galeries Lafayette.\"');
INSERT INTO `phrase_det` VALUES ('8214', '8202', '3', 'En l\'espace de magasins \"Galeries Lafayette\" présente gamme complète de collections de produits de luxe - des montres et des bijoux, des vêtements, des chaussures et des accessoires de luxe (pour femmes, hommes, adolescents et enfants) - à éblouissante dans sa beauté et la qualité des articles pour la maison de célèbres maisons de mode du monde et de la conception. Cette richesse et la diversité difficile d\'imaginer dans quel - jamais un format de magasin en particulier \"boutique\", que ce soit à Londres ou à Paris. La forte concentration de marques célèbres, assemblé à l\'unisson sur les zones commerçantes exquis \"Galeries Lafayette\" - ce qui est ce qui distingue les «grands magasins» («Grands Magasins») niveau «Galeries Lafayette».');
